'use strict';

const express = require('express');
const http = require('http');
const bg = require("@imgly/background-removal-node");
const fs = require("fs");
const path = require("path");
const os = require('os');
const base = require('file64');
const {
  base64ToBlob,
  blobToBase64
} = base


// import { base64ToBlob } from 'file64';
const removeBackground = bg.removeBackground;

// Constants
const PORT = 8080;
const HOST = '0.0.0.0';

// App
const cc = async () => {
  const event = {
    img: "data:image/jpeg;base64,"
  }
  let er = null;
  //   base 64 to array buffer
  const imageBase64 = event.img;
  let res = null;

  // const arrayBffr = Buffer.from(imageBase64, "base64");
  console.time()
  const arrayBffr =await base64ToBlob(imageBase64);
  console.timeEnd()

  const p = path.join(process.cwd(), "image.jpg");
  console.log(p);
  let resbase64 = "";
  try {
    console.log("conversion started", p);
   
    console.time()
    const result = await removeBackground(arrayBffr);
    console.timeEnd()
    res = await blobToBase64(result);
   
    const i =  Buffer.from(await result.arrayBuffer());
    fs.writeFileSync(path.join(process.cwd(), "converted", "sdhggshdghsgh.jpg"), i);
    console.log(" DONE");
  } catch (error) {
    console.log("ERROR FOUND");
    console.error(`Error processing request: ${error.message}`, {
      stack: error.stack,
    });
    throw error; // Re-throwing the error if you want AWS Lambda to mark this execution as failed

    er = error;
    console.error(error);
  }

  const response = {
    statusCode: 200,
    body: JSON.stringify({
      mgs: "Hello from Lambda!",
      err: er,
      path: res,
     
    }),
  };

  
  return response;
};

const app = express();

app.get('/', async (req, res) => {
  const x =  await cc();
  res.send('Hello world\n'+JSON.stringify(x));
});

app.listen(PORT, HOST);
console.log(`Running on http://${HOST}:${PORT}`);